<!DOCTYPE html>
<html lang="ja">
  <head>
    <meta charset="UTF-8" />
    <meta
      name="viewport"
      content="width=device-width, initial-scale=1.0, viewport-fit=cover"
    />
    <title>南米ストリートサッカー：Dream Run</title>
    <style>
      :root {
        color-scheme: dark;
      }

      * {
        box-sizing: border-box;
      }

      body {
        margin: 0;
        font-family: "Noto Sans JP", "Hiragino Kaku Gothic ProN", system-ui,
          -apple-system, BlinkMacSystemFont, sans-serif;
        background: radial-gradient(circle at 20% 20%, #032026, #01090d 60%);
        color: #f7fbff;
        overflow: hidden;
        user-select: none;
        touch-action: manipulation;
      }

      #app {
        position: relative;
        width: 100vw;
        height: 100vh;
        overflow: hidden;
      }

      canvas {
        width: 100%;
        height: 100%;
        display: block;
        background: radial-gradient(circle at 50% 20%, #063b2e, #041c17 70%);
      }

      .hidden {
        opacity: 0;
        pointer-events: none;
      }

      #hud {
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        display: flex;
        justify-content: space-between;
        padding: clamp(12px, 4vw, 32px);
        gap: 16px;
        transition: opacity 0.3s ease;
        pointer-events: auto; /* allow interaction with HUD controls */
        align-items: center;
      }

      #hud .card {
        background: rgba(1, 15, 17, 0.55);
        border: 1px solid rgba(119, 254, 255, 0.24);
        padding: clamp(10px, 2.2vw, 16px) clamp(14px, 3vw, 22px);
        border-radius: 16px;
        box-shadow: 0 16px 32px rgba(0, 0, 0, 0.25);
        min-width: 0;
        backdrop-filter: blur(8px);
      }

      /* small player icon shown in HUD */
      .player-icon {
        width: 36px;
        height: 36px;
        object-fit: contain;
        border-radius: 8px;
        margin-left: 10px;
        vertical-align: middle;
        box-shadow: 0 6px 14px rgba(0,0,0,0.35);
        border: 1px solid rgba(255,255,255,0.06);
      }

      #hud .card strong {
        font-size: clamp(14px, 3.2vw, 18px);
        letter-spacing: 0.08em;
      }

      #hud .card span {
        display: block;
        font-size: clamp(12px, 3vw, 16px);
        opacity: 0.86;
        margin-top: 4px;
      }

      /* audio controls */
      .audio-controls {
        display: flex;
        align-items: center;
        gap: 10px;
      }

      .audio-controls button {
        background: rgba(10, 30, 34, 0.7);
        border: 1px solid rgba(144, 236, 255, 0.14);
        color: #cffeff;
        padding: 8px 10px;
        border-radius: 10px;
        font-weight: 600;
      }

      .audio-controls input[type="range"] {
        width: 110px;
      }
      /* progress bar removed per request */
.overlay {
        position: absolute;
        inset: 0;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        text-align: center;
        padding: clamp(20px, 6vw, 48px);
        background: rgba(2, 10, 12, 0.78);
        backdrop-filter: blur(10px);
        transition: opacity 0.4s ease;
      }

      #menu h1 {
        font-size: clamp(24px, 6vw, 42px);
        line-height: 1.2;
        margin-bottom: clamp(12px, 3vw, 20px);
        text-shadow: 0 10px 24px rgba(0, 0, 0, 0.4);
      }

      #menu p {
        font-size: clamp(15px, 4vw, 18px);
        line-height: 1.7;
        max-width: 620px;
        margin: 0 auto clamp(28px, 7vw, 36px);
        color: rgba(241, 248, 255, 0.92);
      }

      .difficulty-buttons {
        display: flex;
        flex-direction: column;
        gap: clamp(12px, 3vw, 18px);
        width: min(420px, 100%);
      }

      .difficulty-buttons button {
        background: linear-gradient(135deg, rgba(7, 25, 32, 0.9), rgba(6, 65, 67, 0.92));
        border: 1px solid rgba(122, 244, 255, 0.28);
        border-radius: 20px;
        padding: clamp(16px, 4vw, 22px);
        display: flex;
        flex-direction: column;
        align-items: stretch;
        color: #e1fbff;
        font-size: clamp(15px, 4vw, 18px);
        font-weight: 600;
        gap: 6px;
        box-shadow: 0 18px 32px rgba(0, 0, 0, 0.35);
        transition: transform 0.15s ease, box-shadow 0.2s ease;
      }

      .difficulty-buttons button:active {
        transform: scale(0.97);
        box-shadow: 0 8px 20px rgba(0, 0, 0, 0.32);
      }

      .difficulty-buttons button .row {
        display: flex;
        justify-content: space-between;
        align-items: baseline;
        gap: 12px;
      }

      .difficulty-buttons .price {
        font-size: clamp(22px, 6vw, 30px);
        font-weight: 800;
        letter-spacing: 0.02em;
      }

      .difficulty-buttons .name {
        font-size: clamp(16px, 5vw, 20px);
        letter-spacing: 0.18em;
        opacity: 0.92;
      }

      .badge {
        align-self: flex-end;
        padding: 6px 12px;
        border-radius: 999px;
        font-size: clamp(12px, 3.6vw, 14px);
        letter-spacing: 0.06em;
        font-weight: 500;
      }

      .badge.bad {
        background: rgba(255, 82, 82, 0.16);
        color: #ff9f9f;
        border: 1px solid rgba(255, 98, 98, 0.4);
      }

      .badge.mid {
        background: rgba(255, 214, 94, 0.16);
        color: #ffe9a3;
        border: 1px solid rgba(255, 214, 94, 0.42);
      }

      .badge.good {
        background: rgba(110, 255, 205, 0.18);
        color: #afffe1;
        border: 1px solid rgba(138, 255, 220, 0.42);
      }

      #message h2 {
        font-size: clamp(26px, 7vw, 38px);
        margin-bottom: 12px;
      }

      #message p {
        font-size: clamp(15px, 4vw, 18px);
        line-height: 1.7;
        max-width: min(520px, 90vw);
        margin: 0 auto;
      }

      #message button {
        margin-top: clamp(18px, 4vw, 24px);
        width: min(320px, 88vw);
      }

      button.secondary {
        background: rgba(6, 30, 36, 0.8);
        border: 1px solid rgba(144, 236, 255, 0.32);
        color: #b8f5ff;
      }

      button {
        border: none;
        cursor: pointer;
      }

      #joystick {
        position: absolute;
        bottom: clamp(20px, 7vh, 48px);
        left: clamp(18px, 8vw, 52px);
        width: clamp(120px, 28vw, 168px);
        aspect-ratio: 1 / 1;
        border-radius: 50%;
        border: 2px solid rgba(144, 247, 255, 0.25);
        background: rgba(0, 13, 18, 0.55);
        display: flex;
        justify-content: center;
        align-items: center;
        box-shadow: 0 18px 36px rgba(0, 0, 0, 0.35);
        touch-action: none;
        transition: opacity 0.25s ease;
      }

      /* mobile / portrait adjustments */
      @media (max-width: 640px), (orientation: portrait) {
        #hud {
          flex-direction: column;
          align-items: center;
          gap: 10px;
          padding: 12px;
        }

        #joystick {
          left: 50%;
          transform: translateX(-50%);
          bottom: clamp(10px, 5vh, 20px);
          width: clamp(92px, 22vw, 140px);
        }

        .audio-controls input[type="range"] {
          width: 84px;
        }

        .difficulty-buttons {
          width: 100%;
        }
      }

      #joystick.active {
        border-color: rgba(144, 247, 255, 0.6);
      }

      #joystick .ring {
        position: absolute;
        width: 70%;
        height: 70%;
        border: 1.6px dashed rgba(180, 255, 255, 0.35);
        border-radius: 50%;
      }

      #joystick-stick {
        width: 38%;
        height: 38%;
        border-radius: 50%;
        background: rgba(111, 255, 220, 0.82);
        box-shadow: 0 8px 16px rgba(0, 0, 0, 0.4);
        transform: translate(0, 0);
        transition: transform 0.12s ease;
      }

      @media (min-width: 860px) {
        #hud {
          padding: 26px 40px;
        }

        #joystick {
          left: clamp(30px, 10vw, 88px);
          width: clamp(120px, 18vw, 180px);
        }

        body {
          font-size: 16px;
        }
      }

      @media (prefers-reduced-motion: reduce) {
        *,
        *::before,
        *::after {
          animation-duration: 0.01ms !important;
          animation-iteration-count: 1 !important;
          transition-duration: 0.01ms !important;
          scroll-behavior: auto !important;
        }
      }
    </style>
  </head>
  <body>
    <div id="app">
      <canvas id="gameCanvas"></canvas>

      <div id="hud" class="hidden">
        <div class="card">
          <strong id="difficulty-label">EASY</strong>
          <img id="hud-player-icon" class="player-icon" alt="player icon" />
          <span id="price-label">難易度を選択してください</span>
        </div>
        <div class="card">
          <strong>経過 <span id="time-label">0.0</span>s</strong>
        </div>
        <div class="card audio-controls"><button id="bgm-toggle" aria-pressed="false">BGM 再生</button>
          <button id="bgm-mute">ミュート</button>
          <input id="bgm-volume" type="range" min="0" max="1" step="0.01" value="0.7" aria-label="BGM 音量">
        </div>
      </div>

      <div id="joystick" class="hidden">
        <div class="ring"></div>
        <div id="joystick-stick"></div>
      </div>

      <div id="menu" class="overlay">
        <h1>南米ストリートサッカー：Dream Run</h1>
        <p>
          左の裏路地からスタートして、一番右のゴールに叩き込め！支払う金額で難易度が激変。
          指でドラッグしてドリブルし、襲いかかるスライディングをかわそう。
        </p>
        <div class="difficulty-buttons">
          <button data-difficulty="hard">
            <div class="row">
              <span class="price">$0</span>
              <span class="name">HARD</span>
            </div>
            <span class="badge bad">容赦なし、ぶつかったら即 Game Over</span>
          </button>
          <button data-difficulty="normal">
            <div class="row">
              <span class="price">$10</span>
              <span class="name">NORMAL</span>
            </div>
            <span class="badge mid">そこそこ手加減、読み合いの中盤</span>
          </button>
          <button data-difficulty="easy">
            <div class="row">
              <span class="price">$100</span>
              <span class="name">EASY</span>
            </div>
            <span class="badge good">VIP待遇、当たった相手が吹っ飛ぶ！</span>
          </button>
        </div>
      </div>

      <div id="message" class="overlay hidden">
        <h2 id="message-title">GOOOOL!!!</h2>
        <p id="message-text"></p>
        <button id="retry">同じ難易度でリトライ</button>
        <button id="back-to-menu" class="secondary">難易度選択に戻る</button>
      </div>
    </div>

  function base64ToBlobUrl(base64, mimeType) {
    const binary = atob(base64);
    const length = binary.length;
    const bytes = new Uint8Array(length);
    for (let i = 0; i < length; i += 1) {
      bytes[i] = binary.charCodeAt(i);
    }
    const blob = new Blob([bytes], { type: mimeType });
    return URL.createObjectURL(blob);
  }

  const PLAYER_IMAGE_URL = base64ToBlobUrl(PLAYER_IMAGE_BASE64, "image/png");
  const ENEMY_IMAGE_URL = base64ToBlobUrl(ENEMY_IMAGE_BASE64, "image/png");
  const HUD_ICON_URL = PLAYER_IMAGE_URL;

  const playerImg = new Image();

        function resizeCanvas() {
          const width = window.innerWidth;
          const height = window.innerHeight;
          canvas.style.width = `${width}px`;
          canvas.style.height = `${height}px`;
          canvas.width = Math.round(width * DPR);

        }

        window.addEventListener("resize", resizeCanvas);

        function clamp(value, min, max) {
          return Math.min(max, Math.max(min, value));
        }

        function randomRange(min, max) {
          return Math.random() * (max - min) + min;
        }

        function resetPlayerPosition() {

          player.y = field.height / 2;

        function updateKeyVector() {
          keyVector.x =
            (keys["ArrowRight"] || keys["KeyD"] ? 1 : 0) -
            (keys["ArrowLeft"] || keys["KeyA"] ? 1 : 0);
          keyVector.y =
            (keys["ArrowDown"] || keys["KeyS"] ? 1 : 0) -
            (keys["ArrowUp"] || keys["KeyW"] ? 1 : 0);
          if (keyVector.x || keyVector.y) {
            const length = Math.hypot(keyVector.x, keyVector.y);
            keyVector.x /= length;
            keyVector.y /= length;
          }
        }

        const controlKeys = new Set([
          "ArrowUp",
          "ArrowDown",
          "ArrowLeft",
          "ArrowRight",
          "KeyW",
          "KeyA",
          "KeyS",
          "KeyD",
        ]);

        window.addEventListener("keydown", (event) => {
          if (controlKeys.has(event.code)) {
            event.preventDefault();
          }
          keys[event.code] = true;
          updateKeyVector();
        });

        window.addEventListener("keyup", (event) => {
          keys[event.code] = false;
          updateKeyVector();
        });

        function setJoystickVector(event) {
          if (pointerId !== event.pointerId) return;
          const rect = joystick.getBoundingClientRect();
          const centerX = rect.left + rect.width / 2;
          const centerY = rect.top + rect.height / 2;
          const dx = event.clientX - centerX;
          const dy = event.clientY - centerY;
          const maxDistance = rect.width * 0.38;
          const distance = Math.min(Math.hypot(dx, dy), maxDistance);
          const angle = Math.atan2(dy, dx);
          if (maxDistance < 1) {
            joystickVector = { x: 0, y: 0 };
          } else {
            joystickVector.x = (distance / maxDistance) * Math.cos(angle);
            joystickVector.y = (distance / maxDistance) * Math.sin(angle);
          }
          joystickStick.style.transform = `translate(${joystickVector.x * 36}%, ${joystickVector.y * 36}%)`;
        }

        function resetJoystick() {
          joystickVector.x = 0;
          joystickVector.y = 0;
          joystickStick.style.transform = "translate(0, 0)";
          if (pointerId !== null) {
            try {
              joystick.releasePointerCapture(pointerId);
            } catch (err) {
              /* ignore */
            }
          }
          pointerId = null;
          joystick.classList.remove("active");
        }

        joystick.addEventListener("pointerdown", (event) => {
          event.preventDefault();
          pointerId = event.pointerId;
          joystick.setPointerCapture(pointerId);
          joystick.classList.add("active");
          setJoystickVector(event);
        });

        joystick.addEventListener("pointermove", (event) => {
          if (pointerId !== event.pointerId) return;
          setJoystickVector(event);
        });

        joystick.addEventListener("pointerup", (event) => {
          if (pointerId !== event.pointerId) return;
          resetJoystick();
        });

        joystick.addEventListener("pointercancel", resetJoystick);

        const EMBEDDED_BGM_URL = base64ToBlobUrl(EMBEDDED_BGM_BASE64, "audio/mpeg");
        // UI
        const bgmToggle = document.getElementById("bgm-toggle");
        const bgmMute = document.getElementById("bgm-mute");
        const bgmVolume = document.getElementById("bgm-volume");

        // load persisted settings
        let savedMuteFlag = "0";
        try {
          const savedVol = localStorage.getItem("codextest_bgm_vol");
          const savedMuted = localStorage.getItem("codextest_bgm_muted");
          if (savedVol !== null) bgmVolume.value = parseFloat(savedVol);
          if (savedMuted === "1") {
            savedMuteFlag = "1";
          }
        } catch (e) {
          /* ignore */
        }
        if (savedMuteFlag === "1") {
          bgmMute.setAttribute("data-muted", "1");
          bgmMute.textContent = "ミュート中";
        } else {
          bgmMute.setAttribute("data-muted", "0");
        }

        function ensureAudio() {
          if (audioCtx) {
            if (audioCtx.state === "suspended") {
              audioCtx.resume();
            }
            return true;
          }
          const AudioContextCtor =
            window.AudioContext || window.webkitAudioContext;
          if (!AudioContextCtor) return false;
          audioCtx = new AudioContextCtor();
          masterGain = audioCtx.createGain();
          masterGain.gain.value = 0.7;
          masterGain.connect(audioCtx.destination);


          sfxGain = audioCtx.createGain();
          sfxGain.gain.value = 0.8;
          sfxGain.connect(masterGain);
          return true;
        }

        function startBgm() {
          ensureAudio();
          if (!htmlAudio) {
            htmlAudio = new Audio(EMBEDDED_BGM_URL);
            htmlAudio.loop = true;
            htmlAudio.preload = "auto";
            htmlAudio.muted = bgmMute.getAttribute("data-muted") === "1";
          }
          if (bgmFadeHandle) {
            cancelAnimationFrame(bgmFadeHandle);
            bgmFadeHandle = null;
          }
          const desired = parseFloat(bgmVolume.value || 0.7);
          htmlAudio.volume = desired;
          htmlAudio.play().then(() => {
            bgmToggle.textContent = "BGM 停止";
            bgmToggle.setAttribute("aria-pressed", "true");
          }).catch(() => {
            bgmToggle.textContent = "BGM 再生 (クリックで許可)";
            bgmToggle.setAttribute("aria-pressed", "false");
          });
        }

        function fadeBgmDown() {
          if (!htmlAudio) return;
          if (bgmFadeHandle) {
            cancelAnimationFrame(bgmFadeHandle);
            bgmFadeHandle = null;
          }
          const startVol = htmlAudio.volume;
          const baseVol = parseFloat(bgmVolume.value || 0.7);
          const targetVol = Math.max(0, baseVol * 0.35);
          if (startVol <= targetVol) return;
          const duration = 600;
          const startTime = performance.now();

          const step = (now) => {
            const elapsed = now - startTime;
            const ratio = Math.min(1, elapsed / duration);
            htmlAudio.volume = startVol + (targetVol - startVol) * ratio;
            if (ratio < 1) {
              bgmFadeHandle = requestAnimationFrame(step);
            } else {
              bgmFadeHandle = null;
            }
          };

          bgmFadeHandle = requestAnimationFrame(step);
        }

        function playSfx(type) {
          if (!ensureAudio() || !audioCtx || !sfxGain) return;
          const now = audioCtx.currentTime;
          const osc = audioCtx.createOscillator();
          const gain = audioCtx.createGain();
          let duration = 0.3;

          switch (type) {
            case "tackle":
              osc.type = "square";
              osc.frequency.setValueAtTime(190, now);
              osc.frequency.exponentialRampToValueAtTime(60, now + 0.32);
              gain.gain.setValueAtTime(0.7, now);
              gain.gain.exponentialRampToValueAtTime(0.001, now + 0.34);
              duration = 0.36;
              break;
            case "bounce":
              osc.type = "sine";
              osc.frequency.setValueAtTime(420, now);
              osc.frequency.linearRampToValueAtTime(660, now + 0.18);
              gain.gain.setValueAtTime(0.6, now);
              gain.gain.linearRampToValueAtTime(0.001, now + 0.26);
              duration = 0.28;
              break;
            case "goal":
              osc.type = "triangle";
              osc.frequency.setValueAtTime(392, now);
              osc.frequency.linearRampToValueAtTime(523, now + 0.2);
              gain.gain.setValueAtTime(0.8, now);
              gain.gain.linearRampToValueAtTime(0.001, now + 0.6);
              duration = 0.62;
              break;
            case "slide":
              osc.type = "sawtooth";
              osc.frequency.setValueAtTime(260, now);
              osc.frequency.linearRampToValueAtTime(210, now + 0.22);
              gain.gain.setValueAtTime(0.35, now);
              gain.gain.linearRampToValueAtTime(0.001, now + 0.26);
              duration = 0.28;
              break;
            default:
              osc.type = "sine";
              gain.gain.setValueAtTime(0.4, now);
              gain.gain.linearRampToValueAtTime(0.001, now + 0.2);
              duration = 0.24;
          }

          osc.connect(gain);
          gain.connect(sfxGain);
          osc.start(now);
          osc.stop(now + duration);
          osc.addEventListener("ended", () => {
            gain.disconnect();
            osc.disconnect();
          });
        }

                function stopBgm() {
          if (bgmFadeHandle) {
            cancelAnimationFrame(bgmFadeHandle);
            bgmFadeHandle = null;
          }
          if (htmlAudio) {
            try {
              htmlAudio.pause();
              htmlAudio.currentTime = 0;
            } catch (e) {}
          }
          bgmToggle.textContent = "BGM 再生";
          bgmToggle.setAttribute("aria-pressed", "false");
        }

                function setVolume(v) {
          const vol = parseFloat(v);
          if (htmlAudio) htmlAudio.volume = vol;
          try {
            localStorage.setItem("codextest_bgm_vol", String(vol));
          } catch (e) {}
        }

                function toggleMute() {
          const isMuted = bgmMute.getAttribute("data-muted") === "1";
          const nextMuted = !isMuted;
          bgmMute.setAttribute("data-muted", nextMuted ? "1" : "0");
          bgmMute.textContent = nextMuted ? "ミュート中" : "ミュート";
          if (htmlAudio) htmlAudio.muted = nextMuted;
          try {
            localStorage.setItem("codextest_bgm_muted", nextMuted ? "1" : "0");
          } catch (e) {}
        }

        // Hook up UI
        bgmToggle.addEventListener("click", () => {
          const pressed = bgmToggle.getAttribute("aria-pressed") === "true";
          if (pressed) {
            stopBgm();
          } else {
            startBgm();
          }
        });

        bgmMute.addEventListener("click", toggleMute);
        bgmVolume.addEventListener("input", (e) => {
          setVolume(e.target.value);
        });

        function spawnOpponent() {
          if (!currentDifficulty) return;
          const diff = currentDifficulty;
          opponents.push({
            x: field.width + 60,
            y: randomRange(80, field.height - 80),
            radius: 22,
            vx: -diff.baseSpeed,
            vy: 0,
            cooldown: randomRange(diff.slideCooldown[0], diff.slideCooldown[1]),
            slideTimer: 0,
            rotation: Math.random() * Math.PI * 2,
            state: diff.bounce ? "easy" : "active",
            knockTimer: 0,
          });
        }

        function checkCollision(a, b) {
          const dx = a.x - b.x;
          const dy = a.y - b.y;
          const limit = a.radius + b.radius - 2;
          return dx * dx + dy * dy <= limit * limit;
        }

        function handleCollision(opponent) {
          if (!currentDifficulty) return;
          if (currentDifficulty.bounce) {
            if (opponent.state === "knocked") return;
            const dx = opponent.x - player.x;
            const dy = opponent.y - player.y;
            const angle = Math.atan2(dy, dx);
            const power = 380;
            opponent.vx = Math.cos(angle) * power;
            opponent.vy = Math.sin(angle) * power;
            opponent.state = "knocked";
            opponent.knockTimer = 0.9;
            playSfx("bounce");
          } else {
            playSfx("tackle");
            fadeBgmDown();
            endGame(false);
          }
        }

        function startGame(key) {
          const diff = difficulties[key];
          if (!diff) return;
          currentDifficulty = diff;
          opponents = [];
          spawnTimer = randomRange(diff.spawn[0] * 0.5, diff.spawn[0]);
          elapsedTime = 0;
          state = "playing";
          goalGlow = 0;
          resetPlayerPosition();
          timeLabel.textContent = "0.0";
          difficultyLabel.textContent = `${diff.price} | ${diff.name}`;
          priceLabel.textContent = diff.description;
          priceLabel.style.color = diff.tint;
          hud.classList.remove("hidden");
          joystick.classList.remove("hidden");
          menu.classList.add("hidden");
          message.classList.add("hidden");
          resetJoystick();
          startBgm();
          lastTimestamp = performance.now();
        }

        function endGame(success) {
          if (state !== "playing") return;
          state = success ? "win" : "gameover";
          resetJoystick();
          joystick.classList.add("hidden");
          if (success) {
            playSfx("goal");
            goalGlow = 2.6;
          }
          fadeBgmDown();
          messageTitle.textContent = success ? "GOOOOL!!!" : "倒された...";
          if (currentDifficulty) {
            const timeText = `到達タイム ${elapsedTime.toFixed(1)} 秒`;
            if (success) {
              messageText.textContent = `${currentDifficulty.price} (${currentDifficulty.name}) を支払って突破成功！ ${timeText}`;
            } else if (currentDifficulty.bounce) {
              messageText.textContent =
                "VIP待遇でも油断禁物。相手が吹っ飛ぶあいだにゴールを決めよう！";
            } else {
              messageText.textContent = `相手のスライディングに倒されてしまった。${timeText}`;
            }
          } else {
            messageText.textContent = "難易度を選び直してください。";
          }
          message.classList.remove("hidden");
        }

        function goToMenu() {
          state = "menu";
          menu.classList.remove("hidden");
          hud.classList.add("hidden");
          message.classList.add("hidden");
          joystick.classList.add("hidden");
          fadeBgmDown();
          resetPlayerPosition();
          opponents = [];
          elapsedTime = 0;
          
          timeLabel.textContent = "0.0";
        }

        difficultyButtons.forEach((button) => {
          button.addEventListener("click", () => {
            const diffKey = button.getAttribute("data-difficulty");
            startGame(diffKey);
          });
        });

        retryButton.addEventListener("click", () => {
          if (!currentDifficulty) {
            goToMenu();
            return;
          }
          startGame(currentDifficulty.key);
        });

        backButton.addEventListener("click", () => {
          goToMenu();
        });

        function update(dt) {
          if (!currentDifficulty) return;
          elapsedTime += dt;
          timeLabel.textContent = elapsedTime.toFixed(1);

          let inputX = keyVector.x + joystickVector.x;
          let inputY = keyVector.y + joystickVector.y;
          const magnitude = Math.hypot(inputX, inputY);
          if (magnitude > 1) {
            inputX /= magnitude;
            inputY /= magnitude;
          }

          player.x += inputX * player.speed * dt;
          player.y += inputY * player.speed * dt;
          player.x = clamp(
            player.x,
            player.radius + 32,
            field.width - player.radius - 8
          );
          player.y = clamp(
            player.y,
            player.radius + 36,
            field.height - player.radius - 36
          );

          const diff = currentDifficulty;
          spawnTimer -= dt;
          if (spawnTimer <= 0) {
            spawnOpponent();
            spawnTimer = randomRange(diff.spawn[0], diff.spawn[1]);
          }

          for (const opponent of opponents) {
            if (opponent.state === "knocked") {
              opponent.x += opponent.vx * dt;
              opponent.y += opponent.vy * dt;
              opponent.vx *= 0.9;
              opponent.vy *= 0.9;
              opponent.knockTimer -= dt;
              if (opponent.knockTimer <= 0) {
                opponent.state = "fading";
              }
              continue;
            }

            if (opponent.state === "fading") continue;

            opponent.cooldown -= dt;
            if (opponent.slideTimer > 0) {
              opponent.slideTimer -= dt;
            } else if (
              opponent.cooldown <= 0 &&
              Math.abs(opponent.x - player.x) < 260
            ) {
              opponent.slideTimer = 0.36 + Math.random() * 0.16;
              opponent.cooldown = randomRange(
                diff.slideCooldown[0],
                diff.slideCooldown[1]
              );
              if (!diff.bounce) {
                playSfx("slide");
              }
            }

            const chase = player.y - opponent.y;
            opponent.y += chase * diff.chaseResponse * dt;
            opponent.y = clamp(
              opponent.y,
              opponent.radius + 28,
              field.height - opponent.radius - 28
            );

            const slideMultiplier = opponent.slideTimer > 0 ? diff.slideBoost : 1;
            opponent.x += opponent.vx * slideMultiplier * dt;
            opponent.rotation += dt * diff.baseSpeed * 0.02;

            if (checkCollision(player, opponent)) {
              handleCollision(opponent);
            }
          }

          opponents = opponents.filter((opponent) => {
            if (opponent.state === "fading") {
              return false;
            }
            return (
              opponent.x > -140 &&
              opponent.x < field.width + 220 &&
              opponent.y > -140 &&
              opponent.y < field.height + 140
            );
          });

          const progress = clamp(
            (player.x - startX) / (goal.start - startX),
            0,
            1
          );
          // progress bar removed; progress value no longer shown

          if (player.x + player.radius >= goal.start + goal.width * 0.6) {
            endGame(true);
            // progress bar removed
          }
        }

        function drawField() {
          const gradient = ctx.createLinearGradient(0, 0, 0, field.height);
          gradient.addColorStop(0, "#0a4a33");
          gradient.addColorStop(1, "#043324");
          ctx.fillStyle = gradient;
          ctx.fillRect(0, 0, field.width, field.height);

          ctx.strokeStyle = "rgba(255, 255, 255, 0.24)";
          ctx.lineWidth = 2;
          ctx.strokeRect(36, 36, field.width - 72, field.height - 72);

          ctx.beginPath();
          ctx.moveTo(field.width / 2, 36);
          ctx.lineTo(field.width / 2, field.height - 36);
          ctx.strokeStyle = "rgba(255, 255, 255, 0.18)";
          ctx.stroke();

          ctx.beginPath();
          ctx.arc(field.width / 2, field.height / 2, 60, 0, Math.PI * 2);
          ctx.stroke();

          ctx.setLineDash([8, 8]);
          ctx.beginPath();
          ctx.arc(startX, field.height / 2, 52, 0, Math.PI * 2);
          ctx.strokeStyle = "rgba(0, 0, 0, 0.18)";
          ctx.stroke();
          ctx.setLineDash([]);
        }

        function drawGoal() {
          const mouthX = goal.start;
          const mouthWidth = goal.width;
          const mouthHeight = 160;
          const mouthY = field.height / 2 - mouthHeight / 2;

          const netGradient = ctx.createLinearGradient(
            mouthX,
            mouthY,
            mouthX + mouthWidth,
            mouthY + mouthHeight
          );
          netGradient.addColorStop(0, "rgba(255,255,255,0.15)");
          netGradient.addColorStop(1, "rgba(255,255,255,0.05)");
          ctx.fillStyle = netGradient;
          ctx.fillRect(mouthX, mouthY, mouthWidth, mouthHeight);

          const pulse = 0.22 + Math.sin(visualTime * 3.1) * 0.08 + goalGlow * 0.18;
          ctx.strokeStyle = `rgba(255, 255, 255, ${0.34 + goalGlow * 0.14})`;
          ctx.lineWidth = 3 + goalGlow * 1.2;
          ctx.strokeRect(mouthX - 6, mouthY + 8, mouthWidth + 12, mouthHeight - 16);

          ctx.fillStyle = `rgba(17, 228, 255, ${0.12 + pulse * 0.45})`;
          ctx.fillRect(mouthX - 4, mouthY + 14, mouthWidth + 8, mouthHeight - 28);

          goalGlow = Math.max(0, goalGlow - 0.04);
        }

        function drawPlayer() {
          ctx.save();
          if (playerImgLoaded) {
            const w = player.radius * 3.6;
            const h = player.radius * 3.6;
            ctx.drawImage(playerImg, player.x - w / 2, player.y - h / 2, w, h);
            ctx.restore();
            return;
          } else {
            ctx.translate(player.x, player.y);
            ctx.fillStyle = "rgba(10, 20, 23, 0.22)";
            ctx.beginPath();
            ctx.ellipse(-player.radius * 0.4, player.radius * 1.15, player.radius * 1.6, player.radius * 0.7, 0, 0, Math.PI * 2);
            ctx.fill();

            const glow = ctx.createRadialGradient(
              0,
              0,
              player.radius * 0.2,
              0,
              0,
              player.radius * 1.3
            );
            glow.addColorStop(0, "rgba(120, 255, 239, 0.9)");
            glow.addColorStop(1, "rgba(8, 91, 109, 0.2)");
            ctx.fillStyle = glow;
            ctx.beginPath();
            ctx.arc(0, 0, player.radius * 1.15, 0, Math.PI * 2);
            ctx.fill();

            ctx.fillStyle = "#1cd8ff";
            ctx.beginPath();
            ctx.arc(0, 0, player.radius * 0.65, 0, Math.PI * 2);
            ctx.fill();
            ctx.restore();
          }
        }

        function drawOpponents() {
          if (!currentDifficulty) return;
          for (const opponent of opponents) {
            ctx.save();
            if (enemyImgLoaded) {
              const w = opponent.radius * 3.6;
              const h = opponent.radius * 3.6;
              ctx.drawImage(enemyImg, opponent.x - w/2, opponent.y - h/2, w, h);
            } else {
              ctx.translate(opponent.x, opponent.y);
              ctx.rotate(Math.sin(opponent.rotation) * 0.18);

              const intensity =
                opponent.state === "knocked" ? 0.55 : opponent.slideTimer > 0 ? 1 : 0.8;
              const baseColor = currentDifficulty.tint;
              const gradient = ctx.createLinearGradient(
                -opponent.radius,
                -opponent.radius,
                opponent.radius,
                opponent.radius
              );
              gradient.addColorStop(0, `rgba(255,255,255,${0.4 * intensity})`);
              gradient.addColorStop(
                1,
                `rgba(${parseInt(baseColor.slice(1, 3), 16)}, ${parseInt(
                  baseColor.slice(3, 5),
                  16
                )}, ${parseInt(baseColor.slice(5, 7), 16)}, ${0.85 * intensity})`
              );

              ctx.fillStyle = gradient;
              ctx.beginPath();
              ctx.ellipse(
                0,
                0,
                opponent.radius * 1.15,
                opponent.radius * 0.78,
                0,
                0,
                Math.PI * 2
              );
              ctx.fill();
              ctx.lineWidth = 2;
              ctx.strokeStyle = "rgba(0,0,0,0.25)";
              ctx.stroke();
            }
            ctx.restore();
          }
        }

        function render() {
          ctx.setTransform(1, 0, 0, 1, 0, 0);
          ctx.clearRect(0, 0, canvas.width, canvas.height);

          const scale = Math.min(
            canvas.width / field.width,
            canvas.height / field.height
          );
          const offsetX = (canvas.width - field.width * scale) / 2;
          const offsetY = (canvas.height - field.height * scale) / 2;

          ctx.setTransform(scale, 0, 0, scale, offsetX, offsetY);
          drawField();
          drawGoal();
          drawOpponents();
          drawPlayer();
        }

        function loop(timestamp) {
          requestAnimationFrame(loop);
          if (!lastTimestamp) {
            lastTimestamp = timestamp;
            return;
          }
          const delta = Math.min((timestamp - lastTimestamp) / 1000, 0.05);
          lastTimestamp = timestamp;
          visualTime += delta;
          if (state === "playing") {
            update(delta);
          }
          render();
        }

        requestAnimationFrame(loop);
      })();
    </script>
  </body>
</html>
